import React from "react";
import '../scss/main.scss';

const Blog = () => {


    return (
        <section className='blog'>
            <div className='wrapper'>
                <div className='blog__container'>
                    <span className='blog__plan'> Co u nas słychać ?</span>

                </div>
            </div>
        </section>
    )
}

export default Blog;
